const NotFoundPage = () => {
  return (
    <>
      <div className="w-[100vw] h-[100vh] ">
        <div className="top-[20%] left-[18%]">404</div>
        <div className="top-[20%] left-[18%]">Not Found</div>
      </div>
    </>
  );
};
export default NotFoundPage;
